import React from 'react';
import { MainLayout } from './styles/Layouts'; // Ensure this file exists
import Dashboard from './Components/Dashboard/Dashboard';
import Income from './Components/Income/Income';

function App() {
  return (
    <MainLayout>
      <Dashboard />
      <Income />
    </MainLayout>
  );
}

export default App;
